import React from 'react';
import { Carousel } from 'react-bootstrap';
import Schoolcarousel from '../../assets/Schoolcarousel';
import Library from './library.jpg';
import CulturalFest from './cultural_fest.jpg';
import Sports from './sports_day.jpg';
import Classroom from './classroom.jpg';
import SienceExhibition from './science_exhibition.jpg';



function CarouselSection() {
    const images = [
        {
            id:1,
            image:Library,
            imageTitle: library
        },
        {
            id:2,
            image:CulturalFest,
            imageTitle: cultural-fest
        },
        {
            id:3,
            image:Sports,
            imageTitle: sports-day
        },
        {
            id:4,
            image:Classroom,
            imageTitle: classroom
        },
        {
            id:5,
            image:SienceExhibition,
            imageTitle: sience-exhibition
        },
    ]
    return (
        <div className='bg-black text-light py-4 py-sm-5' id='faculty'>
            <div className='container'>
                <div className='row g-4'>
                    <Carousel>
                        {
                            images.map(image => <img src={image.image} alt={image.imageTitle}/>)
                        }
                    </Carousel>

                </div>
            </div>
        </div>
      )
}

export default CarouselSection;
